import React from 'react';
import Head from 'next/head';
import {Provider} from 'react-redux'; 
const App = ({Component}) => {
    return(
        <>
            <Provider>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Lato:100,300,400,700,900" rel="stylesheet"/>
                </Head>
                <Component />
            </Provider> 
        </>
    )
}

export default App;
